        "  dcmFiles = patient_wise_dcmfile[patientId]\n",
        "  detail = {}\n",
        "  file = dicom.read_file(dcmFiles[0])\n",
        "  detail[\"slope\"] = file.RescaleSlope\n",
        "  detail[\"intercept\"] = file.RescaleIntercept\n",
        "  detail[\"thickness\"] = file.SliceThickness\n",
        "  detail[\"pixel_spacing\"] = file.PixelSpacing\n",
        "  patient_wise_detail[patientId] = detail\n",
        "  image_diamantions = (int(file.Rows), int(file.Columns),int(len(dcmFiles)))\n",
        "  arrayDicom = numpy.zeros(image_diamantions, dtype=file.pixel_array.dtype)\n",
        "  for dcmFile in dcmFiles:\n",
        "    arrayDicom[:, :,dcmFiles.index(dcmFile)] = dcmToNumpyArray(dcmFile)\n",
        "  patient_wise_dicom_array_original[patientId] = arrayDicom"
